void word_compare(char* guess_word){
	if(strncmp(correct_word, guess_word, 5)==0){ //all 5 letters equal (dc about null char)
		//set all colours to green -> already accounted for later on!
		/*for (int i = 0; i < WORD_LENGTH; i++){
			colour_of_guess[i] = 2; //2 means green
		}*/
		game_won = true; //still want to display colours
		//return;
	}
	
	//counted letter frequencies -> use this to fix multiple yellows bug -> ISSUE WITH IT
	char correct_letter;
	
	//char guess_word[6] = current_word_guess; //function that returns the word guessed
	char guess_letter;
	int correct_letter_index;
	
	//compare index to index -> turn green: iterate through word and compare letters are corresponding indices only
	for(int i = 0; i < WORD_LENGTH; i++){
		correct_letter = correct_word[i]; //accessing each correct letter
		//printf("1) correct_letter[%d]: %c\n", i, correct_letter);
		
		guess_letter = guess_word[i];//accessing each guess letter
		//printf("1) guess_letter[%d]: %c\n", i, guess_letter);
		
		//compare 
		if(correct_letter == guess_letter){
			printf("Letter correct in right place!\n");
			//change corresponding index to match colour "code"
			colour_of_guess[i] = 2; //2 means green means correct place
			correct_letter_index = correct_letter - 97; 
			correct_letter_count[correct_letter_index]--; //decrement -> using up a correct letter in this guess
		}
		
	}
	
	//compare guess letter to correct word -> turn yellow: iterate through correct word and compare guess letter to all
	for(int i = 0; i < WORD_LENGTH; i++){ //iterate through guess word
		guess_letter = guess_word[i]; //access each guess letter
		
		for(int j = 0; j < WORD_LENGTH; j++){ //iterate through correct word
			if(colour_of_guess[i] != 2){ //-1 means unset -> dont want to change again if already green
				correct_letter = correct_word[j];
				correct_letter_index = correct_letter - 97; //if correct letter count at this index>0, means more instances of this letter exist
				if(correct_letter == guess_letter && correct_letter_count[correct_letter_index]>0){
					printf("guess_letter[%d]: %c\n", i, guess_letter);
					printf("correct_letter[%d]: %c\n", j, correct_letter);
					printf("Letter correct in wrong place.\n");
					colour_of_guess[i] = 1; //1 means yellow
					correct_letter_count[correct_letter_index]--; //using up correct letter (wrong place) in this guess
				} //else dont turn 
				
			}
		}
		
	}//should leave this loop with an array of colour "codes" for guess_word

	for(int i = 0; i < WORD_LENGTH; i++){
		if(colour_of_guess[i] == -1){ colour_of_guess[i] = 0; } //unset -> set to grey
	}
	
	//printf("HELLO\n");
	for (int i = 0; i < WORD_LENGTH; i++){
		//printf("BELLO\n");
    	display_letter(i, wordIdx, guess_word[i], colour_of_guess[i]);
		printf("colour_of_guess[%d]: %d\n", i, colour_of_guess[i]);
	}
	
}

void alpha_compare(char* guess_word){
	char guess_letter;
	
	for(int i = 0; i < WORD_LENGTH; i++){ //iterate through guess word
		guess_letter = guess_word[i]; //access each guess letter
		if(colour_of_guess[i] == 2){//if that index in colour_of_guess is green -> turn corresponding colour green on alpha
			//printf("GREEN: %d\n", (int)guess_letter - 97);
				//prints ascii codes
				//(int)letter - 97 converts it to its 0-index
			if(colour_of_alpha[(int)guess_letter - 97] == -1 || colour_of_alpha[(int)guess_letter - 97] == 0 || colour_of_alpha[(int)guess_letter - 97] == 1){ colour_of_alpha[(int)guess_letter - 97] = 2; }
				//only set it to green if unset OR wrong (means guessed wrongly but in same word) OR yellow
		} else if(colour_of_guess[i] == 1){//if yellow
			//printf("YELLOW: %d\n", (int)guess_letter - 97);
			if(colour_of_alpha[(int)guess_letter - 97] == -1){colour_of_alpha[(int)guess_letter - 97] = 1; }
				//only set it to yellow if unset
		} else if(colour_of_guess[i] == 0){ //DARK grey
			if(colour_of_alpha[(int)guess_letter - 97] == -1){colour_of_alpha[(int)guess_letter - 97] = 0; }
				//set it to dark grey ONLY if letter in alphabet unset currently
		}
		
	}//should leave this loop with an arrray of colour codes for alpha
	
	for (int i = 0; i < 26; i++){
		printf("colour_of_alpha[%d]: %d\n", i, colour_of_alpha[i]);
    	if (colour_of_alpha[i] != -1) {display_alphabet('a'+i, colour_of_alpha[i]);}
	}
	
}

void find_correct_letter_count(){
	int correct_letter_index; //index of each letter in correct word
	
	//reset all letter counts before recounting to avoid double
	for(int i = 0; i < 26; i++){
		correct_letter_count[i] = 0;
	}
	
	for(int i = 0; i < WORD_LENGTH; i++){
		correct_letter_index = correct_word[i] - 97; //convert 'a' to 0
		correct_letter_count[correct_letter_index]++; //increment num of this letter -> make sure to reset every new word
	}
	
	for(int i = 0; i < 26; i++){
		if(correct_letter_count[i]>0){
			printf("# of %c: %d\n", (char)(i+97), correct_letter_count[i]);
		}
	}
}

void reset_game(){
	//reset status 
	game_won = false;
	game_lost = false;
	reset = false;
	
	//reset array of guessed words
	for(int i = 0; i < 6; i++){ //word index
		for(int j = 0; j < 6; j++){ //letter index
			word_board[i][j] = 0;
		}
	}
	
	//reset alphabet guesses
	for(int i = 0; i < 26; i++){
		colour_of_alpha[i] = -1;
	}
	
	//reset colour coding of last round's guess
	for(int i = 0; i < WORD_LENGTH; i++){
		colour_of_guess[i] = -1;
	}
	
	//reset word & letter count indices of guesses
	letterIdx = 0; //which letter we're on
	wordIdx = 0; //word we're on
	
	reset_display(); //reset background for new game
	select_random(); //new random word
	find_correct_letter_count(); //find number of each letter in correct word
	
}

